import styled from "styled-components";

export const MainConteiner = styled.div`
  margin: 0px auto;
  width: 647px;
  height: 664px;
  background-color: #f4f4f4;
  border-radius: 8px;
  padding-top: 32px;
  @media (max-width: 768px) {
    /* display: none; */
  }
`;
